import React, { Component } from "react";
import { fetchApi } from "../action/Action";
import { connect } from "react-redux";
import { List, Avatar } from 'antd';
import 'antd/dist/antd.less';
import { ListGroup, ListGroupItem } from 'reactstrap';


class ListView extends Component {

    constructor(props) {
        super(props);
        this.state = {
            data: []
        };
    }

    componentDidMount() {
        this.props.fetchApi()
    }

    componentWillReceiveProps(nextProps){
       if (nextProps.reducerListData != this.state.data){
           this.setState({data:nextProps.reducerListData})

       }
    }

    render() {
        //const classes = useStyles();
        const { reducerListData } = this.props
        const { data } = this.state
        console.log('reducerdata',reducerListData.ListApiData)
        console.log(reducerListData.length)
        const propsData = data && data.length > 0 ? data :[]
        console.log('propsdata', propsData)
        console.log('statedata',this.state.data)

        //console.log('reducerList',data)
        return (
            <div>
                <h1>Welcome to ListView page</h1>
                {reducerListData && reducerListData.ListApiData && reducerListData.ListApiData.length > 0 ? reducerListData.ListApiData.map(item => {
                    return (
                        <ListGroup>
                            <ListGroupItem active tag="a" href="#" action>{item.name}</ListGroupItem>

                        </ListGroup>
                    )
                }) : 'null'}

            </div>
        );
    }
}

const mapStateToProps = state => {
    console.log('state', state)
    return {
        reducerListData: state
    };
};

const mapDispatchToProps = dispatch => {
    console.log('dispatch', dispatch)
    return {
        fetchApi: () => dispatch(fetchApi())
    };
};



export default connect(
    mapStateToProps,
    mapDispatchToProps
)(ListView);
